import streamlit as st
import pandas as pd


st.header('Movie')
title = st.text_input('Move title', 'Input movie title')
st.write('Your movie is: ', title)

col1, col2, col3 = st.columns(3)

with col1:
    st.header('Movie 1')
    st.image("data:image/jpeg;base64,")

with col2:
    st.header('Movie 2')
    st.image("data:image/jpeg;base64,")
with col3:
    st.header('Movie 3')
    st.image("data:image/jpeg;base64,")